script: |
  super -f text -I q8991.spq | sort > q8991.out

inputs:
  - name: q8991.spq
    data: |
      SELECT DISTINCT ( + CAST ( + col0 AS INTEGER ) ) * + col2 + + - CAST ( col2 AS REAL ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col1 + + - col1 + col2 - 19 <> col0;
  - name: tab0

outputs:
  - name: q8991.out
    data: |
